import LogoHeaderIcon from '../../ui/LogoHeaderIcon'
import LogoFooterIcon from '../../ui/LogoFooterIcon'

const Logo = ({className, position}) => {

  return (
    <button
      data-btn="root"
      className={`${className}__logo`}
    >
      {position === 'header'         
        ? <LogoHeaderIcon/> 
          
        : <LogoFooterIcon/>}
    </button>
  )
}

export default Logo
